import React, { Component } from 'react';
import {Button, Modal, ModalHeader, ModalBody, ModalFooter} from 'reactstrap';
import {Link,Route,Switch} from 'react-router-dom';
import { AnimatePresence,motion } from 'framer-motion';
import socket from './../apis/port';


export default class landing extends Component {
   

    render() {
        return (
            <AnimatePresence>
            <motion.div className="landing" initial={{opacity:0}} animate={{opacity:1}} exit={{opacity:0}}>
                <h1 className="title">O Tic-Tac-Toe</h1>
                
                    <Button className="session-btn" color="primary" size="md" onClick={this.props.create}>Create Session</Button>

                
                
                    <Button className="session-btn" color="primary" size="md" onClick={this.props.join}>Join Session</Button>
                
                
            </motion.div>
            </AnimatePresence>
        )
    }
}
